import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'imagePipe'
})
export class ImagePipePipe implements PipeTransform {

  transform(value: any, ...args: unknown[]): unknown {

    return value.toUpperCase();
  }

}
